INSERT INTO `faqs` (`id`, `question`, `answer`, `status`, `created_at`, `updated_at`) VALUES
(1, 'How do I determine the correct size for me?', 'You can view the sizing details for a product by clicking on the ‘Size Chart’ link on the product page located below the ‘Quantity’ button. This displays the size chart for the product and helps you decide which size fits you best. You can always return the product if the size you selected does not fit you properly. You can review our returns policy here.', 1, '2022-03-02 08:06:18', '2022-05-02 10:58:48'),
(3, 'What can I do if the product is not available in my size?', 'If a product is not available in your size; please go to the contact details page and email us your details. We’ll send you an email as soon as the item is back in stock. Please note that sometimes we may not be able to procure the item in your size. In such cases you will not receive any mail from us.', 1, '2022-03-10 06:14:28', '2022-05-02 10:59:04'),
(4, 'Do ONN Premium Inners deliver products everywhere in India?', 'We deliver most of our orders within 7 days from the order date. You can find out how long we will need to deliver your order to your specific pin code using the courier serviceability tool located on the right side on all product detail pages.', 1, '2022-03-10 06:15:05', '2022-05-02 11:01:19'),
(5, 'Do ONN premium inners deliver products outside India?', 'No. At this point, ONN premium inners deliver products only within India.', 1, '2022-03-10 06:15:05', '2022-05-02 10:59:38'),
(6, 'How are orders on ONN premium inners delivered to me?', 'All orders placed on ONN web store are dispatched through our own courier service – Blue Dart, First flight, Trackon, and Professional couriers etc. We do not use Speed Post to deliver orders placed on ONN premium inners web stores.', 1, '2022-05-02 10:59:45', '2022-05-02 11:00:07'),
(7, 'How can I find out if ONN premium inner delivers to my PIN Code?', 'If your region is serviceable by any of these courier services – BLUEDART, FIRST FLIGHT, TRACKON, and PROFESSIONAL – then you will receive the products sent by us. In case you are unsure if your region is serviceable by any of the aforementioned courier services then send an email here and we will update you in 24 hours.', 1, '2022-05-02 10:59:52', '2022-05-02 11:00:23'),
(8, 'How long does it take for an order to be delivered to me?', 'We deliver most of our orders within 7 days from the order date. You can find out how long we will need to deliver your order to your specific pin code, please check our delivery and return policy.', 1, '2022-05-02 10:59:52', '2022-05-02 11:00:34');
