INSERT INTO `settings` (`id`, `page_heading`, `content`, `status`, `created_at`, `updated_at`) VALUES
(1, 'about', '<h3>Our Company</h3>\r\n<p>ONN is the new Premium Inners/Men’s Underwear Brand from the house of Lux Industries Limited. Crafted with the latest technology, the ONN range of Onn Premiumwear effectively touches the style nerve of the fashionable Indian male. A vast range of designs, top notch quality and sensible styling has been presented to meet the standards and aspirations of today’s youth. In addition, the very fact that it is actively endorsed by the great fashion icon – Shahrukh Khan – adds yet another feather to its cap.</p>\r\n<h3>Vision &amp; Mission</h3>\r\n<p>We believe in providing our customers with the products to satisfy their needs of ultimate comfort and style at the same time. As the fashion is changing at rapid pace, we aim to make the products meet the desires and aspirations of the youth. We believe in consistently meeting and even surpassing the customer’s values and the expectations that they associate with our brand.<br>\r\nWe are focussing on maintaining and strengthening the brand image in accordance with the brand identity and brand values. We desire to become the best youthful Onn Premiumwear-sportswear and leisure wear brand with top of the mind recall.</p>\r\n<h3>Management Profile</h3>\r\n<p><b>Mr. Ashok Kumar Todi – Chairman, Lux Industries Limited (LIL)</b></p>\r\n<p><i>“Our collaborative efforts will enable us to continue pushing the limits of technology and incite us to develop new products and get closer to our consumer.”</i><br>\r\nThe daily affairs of LIL are run and managed by Mr Ashok Todi. He is the mastermind behind the company’s exponential growth and is responsible for formulating policies of growth and expansion of all the brands under LIL. Mr Ashok Todi also looks after the marketing, advertising and sales functions, including network and distribution of LIL. He is also associated with various philanthropic organizations of the country. Mr Ashok Todi hails from an illustrious family that has been engaged in the hosiery business for over 5 decades and with his vast experience and knowledge he has pulled the entire organisation towards success. Mr. Ashok Todi along with his skilled team of directors has managed to establish the organisation as one of the leaders in the hosiery industry.</p>\r\n<p><b>Mr. Pradeep Kumar Todi – Managing Director, Lux Industries Limited (LIL)</b></p>\r\n<p><i>“From where we stand today, it will enable us only to grow stronger and faster.”</i><br>\r\nMr. Pradeep Todi presently looks after the product development and production functions of the LIL. He comes from a distinguished family that has been involved in the hosiery business for over 50 years. He has vast technical knowledge and experience in the hosiery industry. Mr. Pradeep Todi acts as a stalwart behind the development and successful marketing of many new products launched by Lux.</p>\r\n<p><b>Ms. Priyanka Todi – President Marketing, Lux Industries Limited</b></p>\r\n<p><i>“We are the industry leaders and our strategies with solutions oriented approach will lead us to higher dimensions. ”</i><br>\r\nMs. Priyanka Todi presently heads the advertising department and takes care of the electronic media for LIL, which constitute the largest expenditure for the brand. Being an expert in creativity, she also handles all such work for all the brands of LIL including ONN.</p>', 1, '2022-03-02 13:47:50', '2022-05-02 10:49:49'),
(2, 'terms', '<h3>Terms &amp; Condition in use</h3>\r\n<ul>\r\n<li>Lux Industries Ltd. reserves the rights, at its sole discretion, at any time, for any reason, without prior notice to you, to modify, in whole or in part, these Terms of Use, that governs your access to and use of the Site. These Terms of Use will be posted on the Site with any modifications. Your access to and use of the Site following any such change constitutes your agreement to follow and be bound by those terms as changed.</li>\r\n<li>Your continued use of the Site following the posting of changes or modifications will confirm your acceptance of such changes or modifications. Please review these terms and conditions periodically and check the version date for changes.</li>\r\n</ul>\r\n<h3>Copyright</h3>\r\n<ul>\r\n<li>All copyrighted and copyrightable materials on this Site, including, without limitation, the design, text, search results, graphics, images, pictures, sound files and other files, and the selection and arrangement and compilation of information (“Materials”) thereof are proprietary property of Lux Industries Limited or its licensors, or users and are protected by copyright laws.</li>\r\n<li>You are granted a limited, non-sub licensable right to access this Site, use the Services and print the Materials for your personal, non-commercial, and informational use only.</li>\r\n<li>We reserve the right, without notice and in our sole discretion, to terminate your license to use the Site, and to block or prevent future access to and use of the Site.</li>\r\n<li>The foregoing license grant does NOT include the right for you to: publish, publicly perform or display, or distribute to any third party any Materials, including reproduction on any computer network or broadcast or publications media market, sell or make commercial use of the Site or any Materials; systematically collect and use of any data or content including the use of any data spiders, robots, or similar data gathering, mining or extraction methods; make derivative uses of the Site or the Materials; or use, frame or utilize framing techniques to enclose any portion of this Site (including the images found at this Site or any text or the layout/design of any page or form contained on a page).</li>\r\n</ul>\r\n<h3>Trademark</h3>\r\n<ul>\r\n<li>Except for the limited license granted to you, you are not conveyed any other right or license by implication, estoppels, or otherwise in or under any patent, trademark, copyright, or proprietary right of ONN premium inners or any third party.</li>\r\n<li>GRANDE, COMFORTZ, CASUALZ, SPORTZ, TRENDZ,WARMZ ONN Figure Logos, and all other trademarks, logos and trade names used in this Site are trademarks of Lux Industries Limited, whether registered or not. They may not be used without LIL’s prior written approval.</li>\r\n<li>Any unauthorized use of this Site will terminate the permission or license granted by these Site Terms and may violate applicable law including copyright laws, trademark laws (including trade dress), and communications regulations and statutes.</li>\r\n<li>This website is owned, controlled &amp; operated by Lux Industries Limited.</li>\r\n</ul>\r\n<h3>User Comments, Feedback, and Other Submissions</h3>\r\n<p>All comments, reviews, ratings, feedback, suggestions, ideas, images, and other submissions disclosed, submitted or offered to ONN premium inners through this Site or otherwise disclosed, submitted or offered in connection with your access to and use of this Site (“Submissions”) shall be and remain Lux Industries Ltd. property. Such disclosure, submission or offer of any Submissions shall constitute an assignment to Lux Industries Ltd. of all worldwide right, title and interest, including all copyright or all exclusive licenses to the copyright thereto as may be applicable, in the Submissions, subject to any third party rights. Thus, Lux Industries Ltd. will own exclusively all such right, title and interest, including copyright or all exclusive licenses to the copyright thereto as may be applicable, in the Submissions, subject to any third party rights.</p>', 1, '2022-03-02 13:47:50', '2022-05-02 10:44:08'),
(3, 'privacy', '<h3>General Policy</h3>\r\n<p>ONN Premium Inners is the premium apparel brand from the house of Lux Industries Limited. Please read this policy carefully before you provide us with any personal information. If you have questions about this policy, please email us at –&nbsp;<a class=\"text3\" href=\"mailto:info@keepitonn.com\">info@keepitonn.com</a></p>\r\n<ul>\r\n<li>This policy describes the types of information ONN premium inners gathers from its web site at www.keepitonn.com and partner sites powered by the Lux Industries Limited search functionality and how that information is used.</li>\r\n<li>ONN does not share, rent or sell personal information about you with other people or companies except as described in this privacy policy.</li>\r\n<li>We reserve the right to use in any manner and also to disclose any non-personal information that we collect, including but not limited to cookie and traffic data (see “Cookies and Tracking Technologies”). We do not combine personal information with any of the non-personal information gathered on our site.</li>\r\n</ul>\r\n<h3>Right to Information</h3>\r\n<ul>\r\n<li>We may release personal information when we believe that doing so is appropriate to comply with the law (for example, to respond to a lawful subpoena, warrant or court order); to enforce or apply our policies; to initiate, render, bill, and collect for amounts owed to us; to protect our rights or property; to protect our users from fraudulent, abusive, or unlawful use of, our site or services; or if we reasonably believe that an emergency involving immediate danger of death or serious physical injury to any person requires disclosure of communications or justifies disclosure of records without delay.</li>\r\n<li>We may use third party service providers to assist us with the administration of the site or otherwise perform services on our behalf, including payment transaction processing and sending email. Such third parties may be supplied with or have access to your personal information solely to provide services to us or on our behalf.</li>\r\n<li>We may use third-party ad servers (or ad networks) to deliver ads to you on our behalf. These third-party ad servers may collect and use non-personally identifiable information about your visits to our site in order to present advertisements that may be of interest to you.</li>\r\n<li>Information about our users and the site is a business asset of Lux Industries Limited. Consequently, information about our users, including personal information, will be disclosed as part of any merger or acquisition, creation of a separate business to provide the site, our services or fulfil products, sale or pledge of company assets as well as in the event of an insolvency, bankruptcy or receivership in which personal information would be transferred as one of the business assets of the company.</li>\r\n</ul>\r\n<h3>General Exceptions</h3>\r\n<ul>\r\n<li>If your personal identifiable information changes, or if you no longer desire our service, you may correct, update, delete or deactivate it by logging into your account or by emailing our Customer Support-assistance@keepitonn.com or by contacting us by postal mail at the contact information mentioned&nbsp;<a class=\"text3\" href=\"https://www.keepitonn.com/contact.php\">here.</a></li>\r\n<li>We reserve the right to change this policy should we deem it advisable to do so. If we make significant changes that affect the use or disclosure of your personal information, we will make reasonable efforts to notify you of the changes such as notifying you here, by email, or by means of a notice on our home page and will give you the opportunity to cancel your registration.</li>\r\n</ul>', 1, '2022-03-02 13:47:50', '2022-04-29 14:27:24'),
(4, 'cancellation_and_refund', '<h3>What are the delivery charges?</h3>\r\n<p>We provide free delivery on order valued at Rs 500 or more. If you shop less than Rs 500 we generally charges Rs 50 for shipping. Please check with us to understand what the delivery charges are.</p>\r\n<h3>Are there any hidden costs (sales tax, etc.) on items sold by ONN?</h3>\r\n<p>No. There are zero hidden charges when you make a purchase on ONN products. List prices are final and all-inclusive. The price you see on the product page is exactly what you would pay. Delivery charges are not hidden charges.</p>\r\n<h3>What is the estimated delivery time?</h3>\r\n<p>We generally procure and ship the items within the time specified on the product page. Business days exclude public holidays and Sundays. Estimated delivery time is dependent on the product’s availability and the destination to which the order has to be shipped.</p>\r\n<p>&nbsp;</p>\r\n<h4>Following are the reasons due to which your shipping can be delayed :-</h4>\r\n<h4>In Stock</h4>\r\n<p>For items listed as “In Stock”, we will mention the delivery time based on your location pin code (usually 2-3 business days, 4-5 business days or 4-6 business days in areas where standard courier service is available). For other areas, orders will be sent by Registered Post through the Indian Postal Service which may take 1-2 weeks depending on the location.</p>\r\n<h4>Available</h4>\r\n<p>We might not have the item in stock but can procure it when an order is placed for the item. The delivery time will depend on the estimated procurement time and the estimated shipping time to your location.</p>\r\n<h4>Temporarily Unavailable</h4>\r\n<p>The product is currently out of stock and is not available for purchase. The product could to be in stock soon. Use the ‘Notify Me’ feature to know when it is available for purchase.</p>\r\n<h4>Out of Stock</h4>\r\n<p>Currently, the item is not available for sale. Use the ‘Notify Me’ feature to know once it is available for purchase.</p>\r\n<h4>Permanently Discontinued</h4>\r\n<p>This product is no longer available because it is obsolete and/or its production has been discontinued.</p>\r\n<h4>I need to return an item, how do I arrange for a pick-up?</h4>\r\n<p>Returns are easy.&nbsp;<a href=\"http://www.keepitonn.com/contact.php\">Contact us</a>&nbsp;to initiate a return. You will receive a call explaining the process, once you have initiated a return.</p>\r\n<h3>RETURN</h3>\r\n<p>ONN’s Return and Exchange Policy offers you the option to return or exchange items purchased on ONN within 7 days of the receipt.If you choose to exchange the item for reason of mismatch of size or receipt of a defective item, you will be provided with a replacement of the item, free of cost. However an exchange is subject to availability of the item in our stock.</p>\r\n<h3>The following EXCEPTIONS and RULES apply to this Policy</h3>\r\n<ul>\r\n<li>Certain Onn Premiumwear for example brief and boxers cannot be exchanged or returned.</li>\r\n<li>All items to be returned or exchanged must be unused and in their original condition with all original tags and packaging intact and should not be broken or tampered with.</li>\r\n<li>Only size exchanges are allowed. Items can be exchanged for a similar size or a different size.</li>\r\n<li>Exchanges are allowed only if your address is serviceable for an Exchange by our logistics team.</li>\r\n<li>If you choose to self-ship your returns, kindly pack the items securely to prevent any loss or damage during transit. For all self-shipped returns, we recommend you use a reliable courier service.</li>\r\n</ul>\r\n<h3>To return a product to ONN, please follow these steps</h3>\r\n<p>Keep the item ready to ship to us: You can choose to schedule a pick-up of your order or self-ship your return to us. We offer pick-ups of your return in select locations – this option will be available to you when you submit your return online.</p>\r\n<h3>Self-ship</h3>\r\n<p>If you choose to self-ship, please pack the product in its original package with accompanying tags and a filled out returns form. Kindly address the package to the address of the delivery centre closest to you. We have listed out the addresses of the delivery centres in another section on this page.</p>\r\n<p>We will send you a confirmation email as we receive the shipment at our warehouse.</p>', 1, '2022-03-02 13:47:50', '2022-05-02 10:48:24'),
(5, 'return', '<h3>What are the delivery charges?</h3>\r\n<p>We provide free delivery on order valued at Rs 500 or more. If you shop less than Rs 500 we generally charges Rs 50 for shipping. Please check with us to understand what the delivery charges are.</p>\r\n<h3>Are there any hidden costs (sales tax, etc.) on items sold by ONN?</h3>\r\n<p>No. There are zero hidden charges when you make a purchase on ONN products. List prices are final and all-inclusive. The price you see on the product page is exactly what you would pay. Delivery charges are not hidden charges.</p>\r\n<h3>What is the estimated delivery time?</h3>\r\n<p>We generally procure and ship the items within the time specified on the product page. Business days exclude public holidays and Sundays. Estimated delivery time is dependent on the product’s availability and the destination to which the order has to be shipped.</p>\r\n<p>&nbsp;</p>\r\n<h4>Following are the reasons due to which your shipping can be delayed :-</h4>\r\n<h4>In Stock</h4>\r\n<p>For items listed as “In Stock”, we will mention the delivery time based on your location pin code (usually 2-3 business days, 4-5 business days or 4-6 business days in areas where standard courier service is available). For other areas, orders will be sent by Registered Post through the Indian Postal Service which may take 1-2 weeks depending on the location.</p>\r\n<h4>Available</h4>\r\n<p>We might not have the item in stock but can procure it when an order is placed for the item. The delivery time will depend on the estimated procurement time and the estimated shipping time to your location.</p>\r\n<h4>Temporarily Unavailable</h4>\r\n<p>The product is currently out of stock and is not available for purchase. The product could to be in stock soon. Use the ‘Notify Me’ feature to know when it is available for purchase.</p>\r\n<h4>Out of Stock</h4>\r\n<p>Currently, the item is not available for sale. Use the ‘Notify Me’ feature to know once it is available for purchase.</p>\r\n<h4>Permanently Discontinued</h4>\r\n<p>This product is no longer available because it is obsolete and/or its production has been discontinued.</p>\r\n<h4>I need to return an item, how do I arrange for a pick-up?</h4>\r\n<p>Returns are easy.&nbsp;<a href=\"http://www.keepitonn.com/contact.php\">Contact us</a>&nbsp;to initiate a return. You will receive a call explaining the process, once you have initiated a return.</p>\r\n<h3>RETURN</h3>\r\n<p>ONN’s Return and Exchange Policy offers you the option to return or exchange items purchased on ONN within 7 days of the receipt.If you choose to exchange the item for reason of mismatch of size or receipt of a defective item, you will be provided with a replacement of the item, free of cost. However an exchange is subject to availability of the item in our stock.</p>\r\n<h3>The following EXCEPTIONS and RULES apply to this Policy</h3>\r\n<ul>\r\n<li>Certain Onn Premiumwear for example brief and boxers cannot be exchanged or returned.</li>\r\n<li>All items to be returned or exchanged must be unused and in their original condition with all original tags and packaging intact and should not be broken or tampered with.</li>\r\n<li>Only size exchanges are allowed. Items can be exchanged for a similar size or a different size.</li>\r\n<li>Exchanges are allowed only if your address is serviceable for an Exchange by our logistics team.</li>\r\n<li>If you choose to self-ship your returns, kindly pack the items securely to prevent any loss or damage during transit. For all self-shipped returns, we recommend you use a reliable courier service.</li>\r\n</ul>\r\n<h3>To return a product to ONN, please follow these steps</h3>\r\n<p>Keep the item ready to ship to us: You can choose to schedule a pick-up of your order or self-ship your return to us. We offer pick-ups of your return in select locations – this option will be available to you when you submit your return online.</p>\r\n<h3>Self-ship</h3>\r\n<p>If you choose to self-ship, please pack the product in its original package with accompanying tags and a filled out returns form. Kindly address the package to the address of the delivery centre closest to you. We have listed out the addresses of the delivery centres in another section on this page.</p>\r\n<p>We will send you a confirmation email as we receive the shipment at our warehouse.</p>', 1, '2022-03-02 13:47:50', '2022-05-02 10:52:32'),
